import React from "react";

const Add = (a, b) => {
  let sum = a + b;
  return sum;
};
const Sub = (a, b) => {
  let sub = a - b;
  return sub;
};
const Mul = (a, b) => {
  let mul = a * b;
  return mul;
};
const Div = (a, b) => {
  let div = a / b;
  return div;
};

const Calculator = () => {
  return (
    <>
      <ol>
        <li>Sum of two number is {Add(10, 12)}</li>
        <li>Sub of two number is {Sub(10, 12)}</li>
        <li>Mul of two number is {Mul(10, 12)}</li>
        <li>Div of two number is {Div(10, 12).toFixed(2)}</li>
      </ol>
    </>
  );
};

export default Calculator;
